import axios from 'axios';
import React from 'react';

axios.get('./api/users/')
    .then(res => {
        const result = (res.data);
        r
    })
export default function UserView(){
    return (
        <div className="">
          <table>
            <thead>
            <tr>
              <th>Name</th>
              <th>Gender</th>
            </tr>
            </thead>
            <tbody>
                {result.map((val, key) => {
              return (
                <tr key={key}>
                  <td>{val.name}</td>
                  <td>{val.gender}</td>
                </tr>
              )
            })}
            </tbody>
          </table>
        </div>
      );
}
